import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
// import EnqCard from '../components/EnqCard';

export default class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            email: "",
            senha: "",
            errorMessage: "",
            submitedMessage: ""
        };
        this.handleInputChange = this.handleInputChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.routeChange = this.routeChange.bind(this);
    }

    handleInputChange(event) {
        const target = event.target;
        const value = target.value;
        const name = target.name;

        this.setState({ [name]: value });
    }
    render() {
        return (
            <div>
                <h1 className='Title'>Teste At.Group Backend</h1>
                <h2 className='Title'>Login</h2>
                <b>Email</b>
                <br />
                <input name="email" placeholder="Digite seu Email" onChange={this.handleInputChange} value={this.state.email} type='text'></input>
                <br />
                <b>Senha</b>
                <br />
                <input name="senha" placeholder="Digite sua Senha" onChange={this.handleInputChange} value={this.state.senha} type='text'></input>
                <Link className='Title' to='/register'><h2>Registrar</h2></Link>
                {/* <EnqCard data={enquetes} /> */}
            </div >
        );
    }
}
